function slideShow() {
    const arr = ['https://analyticsinsight.b-cdn.net/wp-content/uploads/2020/11/Artificial-Intelligence-5.jpg', 'https://cdn.kenzie.academy/wp-content/uploads/prod/2020/11/02155935/AdobeStock_241083104-1400x934.jpg'];
    let div = document.getElementById('slideShow');
    let img = document.createElement('img');
    let i = 0;
    setInterval(function () {
        if (i == arr.length) {
            i = 0;
        }
        img.src = arr[i];
        i++
    },4000)
    div.append(img)
}
slideShow()
