function showAttendence() {
    let students = JSON.parse(localStorage.getItem('students'))
    let students_div = document.getElementById('students_div');
    students.forEach(function (el) {
        let div = document.createElement('div');
        let p_name = document.createElement('p');
        p_name.innerText = el.name;
        let p_att = document.createElement('p');
        p_att.innerHTML = el.att;
        let img = document.createElement('img');
        img.src = el.img;
        div.append(img, p_name, p_att);
        students_div.append(div)
    })
}
