function sortlh() {
    let student = JSON.parse(localStorage.getItem('student'));
    students = student.sort(function (a, b) {
        return a.att - b.att;
    })
     showStudents(students);
}
function sorthl() {
    let student = JSON.parse(localStorage.getItem('student'));
    students = student.sort(function (a, b) {
        return b.att - a.att;
    })
    showStudents(students);
}

